use anyhow::Context;

#[derive(Clone, serde::Deserialize)]
#[serde(rename_all = "lowercase")]
pub enum Env {
    Development,
    Staging,
    Production,
}

impl std::fmt::Display for Env {
    fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result {
        match self {
            Env::Development => write!(f, "development"),
            Env::Staging => write!(f, "staging"),
            Env::Production => write!(f, "production"),
        }
    }
}

#[derive(Clone, serde::Deserialize)]
pub struct Config {
    pub env: Env,
    pub database_url: String,
    pub jwt_secret: String,
    pub jwt_aud: String,
    pub jwt_sub: String,
    pub discord_public_key: String,
    pub discord_token: String,
    pub discord_client_id: twilight_model::id::Id<twilight_model::id::marker::ApplicationMarker>,
    pub discord_client_secret: String,
    pub discord_redirect_url: String,
    pub i_dashboard_base_url: String,
}

impl Config {
    pub fn new() -> Result<Self, anyhow::Error> {
        #[cfg(debug_assertions)]
        {
            use dotenv::dotenv;
            dotenv().ok();
        }

        let config = envy::from_env::<Self>().context("Invalid environment variables")?;

        return Ok(config);
    }
}

pub struct Constants {
    pub invite_gif_url: String,

    pub website_home_url: String,
    pub website_commands_url: String,
    pub website_tutorial_url: String,
    pub server_invite_url: String,
    pub bot_invite_url: String,

    pub vote_link_topgg_url: String,
    pub vote_link_discordlistgg_url: String,

    pub bot_name: String,
    pub webhook_name: String,
    pub base_64_logo: String,
}

impl Constants {
    pub fn new() -> Self {
        let bot_name = match &CONFIG.env {
            Env::Production => "EpicFreeGames".to_string(),
            _ => format!("{} EpicFreeGames", &CONFIG.env),
        };

        return Self {
            invite_gif_url: "https://media1.tenor.com/images/8be041fe538a0f292bb85885768341a7/tenor.gif?itemid=5261112".to_string(),

            website_home_url: "https://epicfreegames.net".to_string(),
            website_commands_url: "https://epicfreegames.net/commands".to_string(),
            website_tutorial_url: "https://epicfreegames.net/tutorial".to_string(),
            server_invite_url: "https://discord.gg/49UQcJe".to_string(),
            bot_invite_url: "https://epicfreegames.net/invite".to_string(),

            vote_link_topgg_url: "https://top.gg/bot/719806770133991434/vote".to_string(),
            vote_link_discordlistgg_url: "https://discordlist.gg/bot/719806770133991434/vote".to_string(),

            bot_name: bot_name.clone(),
            webhook_name: format!("{} Notifications", bot_name),
            base_64_logo: get_bot_logo(&CONFIG.env),
        };
    }
}

fn get_bot_logo(env: &Env) -> String {
    match env {
        Env::Production => {
            "".to_string()
        }
        Env::Staging => {
            "".to_string()
        }
        Env::Development => {
            "".to_string()
        }
    }
}

pub static CONFIG: once_cell::sync::Lazy<Config> =
    once_cell::sync::Lazy::new(|| Config::new().expect("Failed to load app config"));

pub static CONSTANTS: once_cell::sync::Lazy<Constants> =
    once_cell::sync::Lazy::new(|| Constants::new());
